import React from 'react'
import '../styles/Output.css'

const Output = props => {
    let output = []
    for (let i = 0; i < props.binaryOutput.length; i++) {
        output.push(`<span className='BinaryOutput' value='${props.charOutput[i]}'>${props.binaryOutput[i]}</span>`)
    }

    return(
        <div className='OutputWrapper'>
            { output.map(span => span) }
        </div>
    )
}

export default Output
